import React from 'react';
import './style.css';
import { Container, Row, Col, Image } from 'react-bootstrap';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import GitHubIcon from '@material-ui/icons/GitHub';
import logoWhite from '../../assets/svg/logo-white.svg';

const styles = {
  icon: {
    fontSize: 40,
    color: '#ffffff'
  },
  background: {
    background: '#121212',
    color: '#fff'
  }
}
export const Footer = () => {

  return (
    <footer className='footer' style={styles.background}>
      <Container fluid>
        <Row className='text-center bg-danger'>
          <Image src={logoWhite}/>
        </Row>
        <Row>
          <Col xs={6} className='d-flex justify-content-end'>
            <a href='https://www.linkedin.com/in/edwardtreyes/' target='_blank'>
              <LinkedInIcon style={styles.icon}/>
            </a>
          </Col>
          <Col xs={2} className='d-flex justify-content-start'>
            <a href='https://github.com/edwardreyes29' target='_blank'>
              <GitHubIcon style={styles.icon}/>
            </a>
          </Col>
        </Row>
        <Row className='text-center'>
          <div className='mt-2 mb-2'>twentytwenty Â© Edward Reyes | All rights reserved.</div>
        </Row>
      </Container>
    </footer>
  )
}
